import * as api from "../helpers/Api";

// action Creators
export const getToken = () => async (dispatch) => {
  try {
    const data = await api.fetchToken();
    dispatch({ type: "FETCH", payload: data });
    return
  } catch (err) {
    console.log(err);
  }
};
